<template>
  <v-layout full-height>
    <v-main dark>
      <SAMScreen v-show="activeScreen === 'SAM'" />
      <EditorScreen ref="editorRef" v-show="activeScreen === 'Editor'" />

      <AppMenu :missions="missions" @open-screen="openScreen" @load-mission="selectMission" />
    </v-main>
  </v-layout>
</template>

<script setup lang="ts">
import { inject, onMounted, ref } from 'vue'
import { useTargetsStore } from '@/store/targets';
import { useTargetRadarStore } from '@/store/targetRadar';
import type { IRecognizedTargets } from './classes/SAM';
import type { Emitter, EventType } from 'mitt';
import AppMenu from '@/components/AppMenu.vue'
import SAMScreen from '@/components/SAM/SAM.vue';
import EditorScreen from '@/components/Editor.vue'

const editorRef = ref()

enum ScreensEnum {
  BIP = 'BIP',
  SAM = 'SAM',
  Editor = 'Editor'
}

const missions: any[] = [
  {
    id: 1,
    name: 'Тест',
    data: `[{"flightObjectTypeId":1,"points":[{"x":62.4,"y":5.6,"z":0.5,"v":208},{"x":4,"y":6.4,"z":0,"v":208}],"rcs":10,"identifier":"----Flight object 1 -1660230116859----","time":0},{"flightObjectTypeId":3,"points":[{"x":64,"y":52.8,"z":5,"v":600},{"x":-9.6,"y":15.2,"z":0,"v":600}],"rcs":4,"identifier":"----Flight object 2 -1660230129052----","time":"0"},{"flightObjectTypeId":8,"points":[{"x":207.2,"y":-15.2,"z":29,"v":1100},{"x":-7.2,"y":-8,"z":0,"v":1100}],"rcs":1.5,"identifier":"----Flight object 3 -1660230142331----","time":"0"},{"flightObjectTypeId":4,"points":[{"x":-22.4,"y":32.8,"z":0.5,"v":13.9},{"x":-20.8,"y":26.4,"z":0.5,"v":13.9},{"x":-22.4,"y":20,"z":0,"v":13.9}],"rcs":0.01,"identifier":"----Flight object 4 -1660230152907----","time":"0"},{"flightObjectTypeId":4,"points":[{"x":-25.6,"y":10.4,"z":0.5,"v":13.9},{"x":-21.6,"y":8.8,"z":0.5,"v":13.9},{"x":-16.8,"y":8,"z":0,"v":13.9}],"rcs":0.01,"identifier":"----Flight object 5 -1660230163052----","time":"0"}]`
  }
]

const activeScreen = ref(ScreensEnum.SAM);
const openScreen = (screen: string) => activeScreen.value = screen as ScreensEnum;
const selectMission = (missionId: number) => {
  editorRef.value.loadMission(missions.find(m => m.id === missionId)!.data)
}

const keyMapHandlers: Record<string, Function> = {
  'KeyA': () => targetRadar.incrementTargetCursorAzimut(-0.5),
  'KeyD': () => targetRadar.incrementTargetCursorAzimut(0.5),
  'KeyW': () => targetRadar.incrementTargetCursorDistance(0.5),
  'KeyS': () => targetRadar.incrementTargetCursorDistance(-0.5),
  'KeyQ': () => targetRadar.incrementTargetCursorElevation(-0.5),
  'KeyE': () => targetRadar.incrementTargetCursorElevation(0.5),
}

const samEventBus = inject<Emitter<Record<EventType, any>>>('samEventBus');
const targetsStore = useTargetsStore()
const targetRadar = useTargetRadarStore()

onMounted(() => {
  window.addEventListener('keydown', (e: KeyboardEvent) => {
    const handler = keyMapHandlers[e.code];
    handler && handler();
  })
  samEventBus!.on('delete', (e: string) => targetRadar.resetCaptureTarget(e))
  samEventBus!.on('update', (e: { targets: IRecognizedTargets[] }) => targetsStore.setTargets(e.targets))
});
</script>

<style>
.custom-background {
  background-size: auto;
  background-repeat: repeat;
  background-image: url("data:image/jpeg;base64,")
}

.map-image {
  background-image: url("data:image/png;base64,")
}
</style>